import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
  return (
    <>
      <NavLink activeClassName="current" to="/">
       <li>React About Us </li> 
      </NavLink>
      <NavLink style={{ color: 'blue' }}  to="/contact">
        <li>React Contact Us</li>
      </NavLink>
      <br />

      <a href="/"> About Us</a>
      <a href="/contact"> Contact Us</a>
    </>
  );
};

export default Menu;
